module.exports = "<h1 mat-dialog-title>{{ type === 'term' ? 'Terms of Service' : 'Privacy Policy' }}</h1>\n<mat-dialog-content>\n  <ng-template [ngIf]=\"type === 'term'\" [ngIfElse]=\"policy\">\n    The Next Media Group (“NMG” or “we”) operates DSODentist, which is an educational and social networking platform that allows dental students and professionals to create unique personal profiles online in order to find and share a professional exchange with fellow dental students and professionals. The services offered by DSODentist include any DSODentist-branded URL (the \"DSODentist Mobile App\"), DSODentist messaging services (including, without limitation, instant messaging, private messaging, and email services), DSODentist video services, DSODentist developer services, DSODentist Mobile services, and any other features, content, or applications offered from time to time by NMG in connection with its business (collectively, the \"DSODentist Services\"). DSODentist Services are hosted in the United States. <br><br>\n    This Terms of Use Agreement, as may be modified from time to time, (\"Agreement\") constitutes legally binding terms and applies to your use of DSODentist. By accessing and/or using DSODentist, you agree to be bound by this Agreement, whether you are a \"Visitor\" (which means that you simply browse DSODentist, including, without limitation, through a mobile or other wireless device, or otherwise use DSODentist without being registered) or you are a \"Member\" (which means that you are a dental student or professional who has registered with DSODentist). The term \"User\" refers to a Visitor or a Member. You are authorized to use DSODentist (regardless of whether your access or use is intended) only if you agree to abide by all applicable laws, rules and regulations (“Applicable Law”) and the terms of this Agreement. In addition, in consideration for becoming a Member and/or making use of DSODentist, you must indicate your acceptance of this Agreement during the registration process. <br><br>\n    NMG reserves the right to modify this Agreement at any time and from time to time, and each such modification shall be effective upon posting on DSODentist. All material modifications will apply prospectively only. Your continued use of DSODentist following any such modification constitutes your agreement to be bound by and your acceptance of the Agreement as so modified. It is therefore important that you review this Agreement regularly. If you do not agree to be bound by this Agreement and to abide by all Applicable Law, you must discontinue use of DSODentist immediately. <br><br>\n    1. Eligibility. Use of DSODentist and registration to be a Member for DSODentist (“Membership”) is void where prohibited. By using DSODentist, you represent and warrant that (a) all registration information you submit is truthful and accurate; (b) you will maintain the accuracy of such information; (c) you are 18 years of age or older; and (d) your use of DSODentist does not violate any Applicable Law. Your profile may be deleted and your Membership may be terminated without warning, and if we believe that you are under 18 years of age and you represent yourself as 18 or older. <br><br>\n    2. Term. This Agreement, and any posted revision to this Agreement, shall remain in full force and effect while you use DSODentist or are a Member. You may terminate your Membership at any time, for any reason, by following the instructions on the Member's Account Settings page. NMG may terminate your Membership at any time, for any or no reason, with or without prior notice or explanation, and without liability. Furthermore, NMG reserves the right, in its sole discretion, to reject, refuse to post or remove any posting (including, without limitation, private messages, emails and instant messages (collectively, “messages”)) by you, or to deny, restrict, suspend, or terminate your access to all or any part of DSODentist at any time, for any or no reason, with or without prior notice or explanation, and without liability. In addition, NMG reserves the right, in its sole discretion, to reassign or rename your profile URL. NMG expressly reserves the right to remove your profile and/or deny, restrict, suspend, or terminate your access to all or any part of DSODentist if NMG determines, in its sole discretion, that you have violated this Agreement or pose a threat to DSODentist, its employees, business partners, Users and/or the public. Even after Membership is terminated, this Agreement will remain in effect, including, without limitation, Sections 5-18. <br><br>\n    3. Fees. You acknowledge that NMG reserves the right to charge for any portion of DSODentist and to change its fees (if any) from time to time in its discretion. If NMG terminates your Membership because you have breached the Agreement, you shall not be entitled to the refund of any unused portion of fees or payments (if any). <br><br>\n    4. Password. When you sign up to become a Member, you will also be asked to choose a password. You are entirely responsible for maintaining the confidentiality of your password. You agree not to use the account, username, email address, or password of another Member at any time or to disclose your password to any third party. You agree to notify NMG immediately if you suspect any unauthorized use of your account or access to your password. You are solely responsible for any and all use of your account. <br><br>\n    5. Use by Members. DSODentist is for the personal use of Members and may only be used for direct commercial purposes if they are specifically endorsed or authorized by NMG. NMG reserves the right to remove commercial content at its sole discretion. Illegal and/or unauthorized use of DSODentist, including, without limitation, collecting usernames, user id numbers, and/or email addresses of Members by electronic or other means for the purpose of sending unsolicited email or unauthorized framing of or linking to DSODentist, or employing third-party promotional apps or software to promote profiles for money, is prohibited. Commercial advertisements, affiliate links, and other forms of unauthorized data collection or solicitation may be removed from Member profiles without notice or explanation and may result in termination of Membership privileges. NMG reserves the right to take appropriate legal action, including, without limitation, referral to law enforcement, for any illegal or unauthorized use of DSODentist. <br><br>\n    6. Proprietary Rights in Content on DSODentist. <br><br>\n    6.1 NMG does not claim any ownership rights in the text, files, images, photos, video, sounds, musical works, works of authorship, applications, or any other materials (collectively, \"Content\") that you transmit, submit, display or publish (“post”) on, through, or in connection with DSODentist. After posting your Content on, through or in connection with DSODentist, you continue to retain any such rights that you may have in your Content, subject to the limited license herein. By posting any Content on, through or in connection with DSODentist, you hereby grant to NMG a limited license to use, modify, delete from, add to, publicly perform, publicly display, reproduce, and distribute such Content solely on, through or in connection with DSODentist, including, without limitation, through DSODentist to applications, widgets, mobile apps, or mobile, desktop, or other services which are linked with your DSODentist account (collectively, “Linked Services”), including, without limitation, distributing part or all of DSODentist and any Content included therein, in any media formats and through any media channels, except that Content marked “private” will not be distributed by NMG outside DSODentist and Linked Services. This limited license does not grant NMG the right to sell or otherwise distribute your Content outside of DSODentist or Linked Services. After you remove your Content from DSODentist, we will cease distribution as soon as practicable, and at such time when distribution ceases, the license will terminate. If after we have distributed your Content outside of DSODentist, you change the Content’s privacy setting to “private,” we will cease distribution of such “private” Content outside of DSODentist as soon as practicable after you make the change. Notwithstanding the foregoing, you understand and agree that once Content is distributed to a Linked Service or incorporated into other aspects of DSODentist, NMG is under no obligation to delete or ask other Users or a Linked Service to delete that Content, and therefore it may continue to appear and be used indefinitely. <br><br>\n    6.2 The license you grant to NMG is non-exclusive (meaning you are free to license your Content to anyone else in addition to NMG), fully-paid and royalty-free (meaning that NMG is not required to pay you or anyone else deriving rights from you for the use on DSODentist of the Content that you post), sublicensable (so that NMG is able to use its affiliates, subcontractors, and other partners such as Internet content delivery networks and wireless carriers to provide DSODentist), and worldwide (because the Internet and DSODentist are global in reach). <br><br>\n    6.3 You represent and warrant that: (i) you own the Content posted by you on, through or in connection with DSODentist, or otherwise have the right to grant the license set forth in this Section 6, and (ii) the posting of your Content on, through or in connection with DSODentist and/or Linked Services does not violate the privacy rights, publicity rights, copyrights, contract rights or any other rights of any person or entity. You agree to pay for all royalties, fees, and any other monies owing any person or entity by reason of the use of any Content posted by you on or through DSODentist and/or Linked Services. <br><br>\n    6.4 DSODentist contains Content of NMG (\"NMG Content\"). NMG Content is protected by copyright, trademark, patent, trade secret and other laws, and NMG owns and retains all rights in the NMG Content and DSODentist. NMG hereby grants you a limited, revocable, nonsublicensable license to reproduce and display the NMG Content (excluding any software code) solely for your personal use in connection with viewing DSODentist mobile app and using DSODentist Services. <br><br>\n    6.5 DSODentist contains Content of Users and other NMG licensors. Except as provided within this Agreement, you may not copy, modify, translate, publish, broadcast, transmit, distribute, perform, display, sell, or otherwise use any Content appearing on or through DSODentist. <br><br>\n    6.6 NMG performs technical functions necessary to offer DSODentist, including, but not limited to, the technical processing and transmission of email communications to perform the email service, and transcoding and/or reformatting Content to allow its use throughout DSODentist. In addition, you agree and acknowledge that NMG may send messages including, but not limited to, notifications, special offers, promotions, commercial advertisements, and marketing materials, in connection with DSODentist. You can control what type of communications you receive from DSODentist by logging into your account and choosing the appropriate notifications settings or by following the unsubscribe instructions contained at the bottom of commercial emails. <br><br>\n    6.7 NMG reserves the right to limit the storage capacity of Content that you post on, through or in connection with DSODentist. <br><br>\n    7. Content Posted. <br><br>\n    Please choose carefully the information that you post on, through or in connection with DSODentist and that you provide to other Users. Your DSODentist profile may not include any form of Prohibited Content, as outlined in Section 8 below. Despite this prohibition, information, materials, products or services provided by other DSODentist Members (for instance, in their profiles) or Linked Services may, in whole or in part, be unauthorized, impermissible or otherwise violate this Agreement, and NMG assumes no responsibility or liability for this material. If you become aware of misuse of DSODentist by any person or Linked Service, please click on the \"Contact Us” in the Main Menu. <br><br>\n    7.1 NMG may reject, refuse to post, or delete any Content for any or no reason, including, but not limited to, Content that in the sole judgment of NMG violates this Agreement or which may be offensive, illegal or violate the rights of any person or entity, or harm or threaten the safety of any person or entity. NMG assumes no responsibility for monitoring DSODentist for inappropriate Content or conduct. If at any time NMG chooses, in its sole discretion, to monitor DSODentist, NMG nonetheless assumes no responsibility for the Content, no obligation to modify or remove any inappropriate Content, and no responsibility for the conduct of the User submitting any such Content. <br><br>\n    7.2 You are solely responsible for the Content that you post on, through or in connection with any of DSODentist, and any material or information that you transmit to other Members and for your interactions with other Users. <br><br>\n    8. Content/Activity Prohibited. The following are examples of the kind of Content that is illegal or prohibited to post on, through or in connection with DSODentist. NMG reserves the right to investigate and take appropriate legal action against anyone who, in NMG's sole discretion, violates this provision, including, without limitation, removing the offending Content from DSODentist, terminating the Membership of such violators and/or reporting such Content or activities to law enforcement authorities. Prohibited Content includes, but is not limited to, Content that, in the sole discretion of NMG: <br><br>\n    8.1 is patently offensive or promotes or otherwise incites racism, bigotry, hatred or physical harm of any kind against any group or individual; <br><br>\n    8.2 harasses or advocates harassment of another person; <br><br>\n    8.3 exploits people in a sexual or violent manner; <br><br>\n    8.4 contains nudity, excessive violence, or offensive subject matter or contains a link to an adult website; <br><br>\n    8.5 solicits or is designed to solicit personal information from anyone under 18; <br><br>\n    8.6 publicly posts information that poses or creates a privacy or security risk to any person; <br><br>\n    8.7 constitutes or promotes information that you know is false or misleading or promotes illegal activities or conduct that is abusive, threatening, obscene, defamatory or libelous; <br><br>\n    8.8 constitutes or promotes an illegal or unauthorized copy of another person's copyrighted work, such as providing pirated computer programs or links to them, providing information to circumvent manufacturer-installed copy-protect devices, or providing pirated music or links to pirated music files; <br><br>\n    8.9 involves the transmission of \"junk mail,\" \"chain letters,\" or unsolicited mass mailing, instant messaging, \"spimming,\" or \"spamming\"; <br><br>\n    8.10 contains restricted or password only access pages or hidden pages or images (those not linked to or from another accessible page); <br><br>\n    8.11 furthers or promotes any criminal activity or enterprise or provides instructional information about illegal activities including, but not limited to, making or buying illegal weapons, violating someone's privacy, or providing or creating computer viruses; <br><br>\n    8.12 solicits or is designed to solicit passwords or personal identifying information for commercial or unlawful purposes from other Users; <br><br>\n    8.13 involves commercial activities and/or sales without prior written consent from NMG such as contests, sweepstakes, barter, advertising, or pyramid schemes; <br><br>\n    8.14 includes a photograph or video of another person that you have posted without that person's consent; <br><br>\n    8.15 uses sexually suggestive imagery or any unfair, misleading or deceptive Content intended to draw traffic to the profile; or <br><br>\n    8.16 violates or attempts to violate the privacy rights, publicity rights, copyrights, trademark rights, contract rights or any other rights of any person. <br><br>\n    The following are examples of the kind of activity that is illegal or prohibited on DSODentist Mobile app and through your use of DSODentist Services. NMG reserves the right to investigate and take appropriate legal action against anyone who, in NMG's sole discretion, violates this provision, including, without limitation, terminating your Membership and/or reporting such activity or Content to law enforcement authorities. Prohibited activity includes, but is not limited to: <br><br>\n    8.17 criminal or tortuous activity, including, but not limited to, child pornography, fraud, trafficking in obscene material, drug dealing, gambling, harassment, defamation, stalking, spamming, spimming, sending of viruses or other harmful files, copyright infringement, patent infringement, or theft of trade secrets; <br><br>\n    8.18 advertising to, or solicitation of, any Member to buy or sell any products or services through the unauthorized or impermissible use of DSODentist. You may not transmit any chain letters or junk email to other Members. In order to protect our Members from such advertising or solicitation, NMG reserves the right to restrict the number of emails which a Member may send to other Members in any 24-hour period to a number which NMG deems appropriate in its sole discretion. If you breach this Agreement and send or cause to send (directly or indirectly) unsolicited bulk messages, status or mood updates, bulletins or other unauthorized commercial communications of any kind through DSODentist, you acknowledge that you will have caused substantial harm to NMG, but that the amount of such harm would be extremely difficult to ascertain. As a reasonable estimation of such harm, you agree to pay NMG $50 for each actual or intended recipient of such unsolicited message, status or mood update, bulletin or other unauthorized commercial communication you send through DSODentist; <br><br>\n    8.19 circumventing or modifying, attempting to circumvent or modify, or encouraging or assisting any other person in circumventing or modifying any security technology or software that is part of DSODentist; <br><br>\n    8.20 activity that involves the use of viruses, bots, worms, or any other computer code, files or programs that interrupt, destroy or limit the functionality of any computer software or hardware, or otherwise permit the unauthorized use of or access to a computer or a computer network; <br><br>\n    8.21 modifying, copying, distributing, downloading, scraping or transmitting in any form or by any means, in whole or in part, any Content from DSODentist other than your Content which you legally post on, through or in connection with DSODentist; <br><br>\n    8.22 providing or using “tracking” or monitoring functionality in connection with DSODentist, including, without limitation, to identify other Users’ views, actions or other activities on DSODentist; <br><br>\n    8.23 covering or obscuring the banner advertisements and/or safety features (e.g., report abuse button) on your personal profile page, or any DSODentist page via HTML/CSS or any other means; <br><br>\n    8.24 any automated use of the system, such as, but not limited to, using scripts to add friends or send comments, messages, status or mood updates, blogs or bulletins; <br><br>\n    8.25 interfering with, disrupting, or creating an undue burden on DSODentist or the networks or services connected to DSODentist; <br><br>\n    8.26 impersonating or attempting to impersonate NMG or an NMG employee, administrator or moderator, another Member, or person or entity (including, without limitation, the use of email addresses associated with or of any of the foregoing); <br><br>\n    8.27 using the account, username, or password of another Member at any time or disclosing your password to any third party or permitting any third party to access your account; <br><br>\n    8.28 selling or otherwise transferring your profile, your email address or URL; <br><br>\n    8.29 using or distributing any information obtained from DSODentist in order to harass, abuse, or harm another person or entity, or attempting to do the same; <br><br>\n    8.30 displaying an unauthorized commercial advertisement on your profile, or accepting payment or anything of value from a third person in exchange for your performing any commercial activity through the unauthorized or impermissible use of DSODentist on behalf of that person, such as placing commercial content on your profile, links to e-commerce apps not authorized by NMG, posting status or mood updates, blogs or bulletins with a commercial purpose, selecting a profile with a commercial purpose as one of your top friends, or sending messages with a commercial purpose; <br><br>\n    8.31 relaying email from a third party's mail servers without the permission of that third party; <br><br>\n    8.32 using invalid or forged headers to disguise the origin of any Content transmitted to or through NMG’s computer systems, or otherwise misrepresenting yourself or the source of any message or Content; <br><br>\n    8.33 using any automated system, including, but not limited to, scripts or bots in order to harvest email addresses or other data from DSODentist for the purposes of sending unsolicited or unauthorized material; <br><br>\n    8.34 engaging in, either directly or indirectly, or encouraging others to engage in, click-throughs generated through any manner that could be reasonably interpreted as coercive, incentivized, misleading, malicious, or otherwise fraudulent; or <br><br>\n    8.35 using DSODentist in a manner inconsistent with any and all Applicable Law. <br><br>\n    9. Protecting Copyrights and Other Intellectual Property. NMG respects the intellectual property of others, and requires that our users do the same. You may not upload, embed, post, email, transmit or otherwise make available any material that infringes any copyright, patent, trademark, trade secret or other proprietary rights of any person or entity. It is NMG’s policy to terminate, in appropriate circumstances, the membership of repeat infringers. <br><br>\n    If you believe your work has been copied and posted on or through DSODentist in a way that constitutes copyright infringement, please send NMG's Copyright Agent a notification of claimed infringement with all of the following information: (a) identification of the copyrighted work claimed to have been infringed, or, if multiple copyrighted works are covered by a single notification, a representative list of such works; (b) identification of the claimed infringing material and information reasonably sufficient to permit us to locate the material on DSODentist (providing the URL(s) of the claimed infringing material satisfies this requirement); (c) information reasonably sufficient to permit us to contact you, such as an address, telephone number, and, if available, an email address; (d) a statement by you that you have a good faith belief that the disputed use is not authorized by the copyright owner, its agent, or the law; (e) a statement by you, made under penalty of perjury, that the above information in your notification is accurate and that you are the copyright owner or are authorized to act on the copyright owner's behalf; and (f) your physical or electronic signature. NMG's Copyright Agent for notification of claimed infringement can be reached as follows: Copyright Agent, The Next Media Group, 1000 Wyckoff Avenue, Mahwah, NJ 07430; Facsimile: (201) 293-0275; Phone: (201) 490-8811; Attn: Copyright Agent. NMG's Copyright Agent for notification of claimed infringement can also be reached electronically at rgroves@thenextmediagroup.com. NMG provides certain tools and technologies to help facilitate copyright owners’ control over their copyrighted works. In order to inquire about the availability of these tools and technologies, please contact NMG’s Copyright Agent at the email address listed. <br><br>\n    10. Third Party Linked Services. Linked Services created by third party developers may be available on, through or in connection with DSODentist. Linked Services include applications, mobile apps, desktop, wireless, mobile and other services available from third parties which can be installed onto your DSODentist profile or shared with other Users on DSODentist or which may link to your DSODentist account from outside of DSODentist. Linked Services may use your DSODentist profile information, connections, and/or other profile content on the Linked Service and share activity events between DSODentist and the Linked Service (depending on the features the Linked Service chooses to make available). <br><br>\n    When you engage with a third party Linked Service, you are interacting with the third party, not with NMG. NMG does not control the third party, and cannot dictate their actions. If you choose to use a third party Linked Service, the Linked Service may use and share your data in accordance with the privacy policy of and your privacy settings on such service. In addition, the third party providing the Linked Service may use other parties to provide portions of the application or service to you, such as technology, development or payment services. NMG is not responsible for and makes no warranties, express or implied, as to the third party Linked Services or the providers of such Linked Services (including, but not limited to, the privacy practices thereof). NMG encourages you not to provide any personally identifiable information to any third party Linked Service unless you know and are comfortable with the party with whom you are interacting. <br><br>\n    11. Member Disputes. You are solely responsible for your interactions with other DSODentist Users, third party developers or any other parties with whom you interact through DSODentist and/or Linked Services. NMG reserves the right, but has no obligation, to become involved in any way with these disputes. <br><br>\n    12. Privacy. Use of DSODentist is also governed by our Privacy Policy, which is incorporated into this Agreement by this reference. <br><br>\n    13. Disclaimers. NMG is not responsible for and makes no warranties, express or implied, as to the User Content or the accuracy and reliability of the User Content posted through or in connection with DSODentist or Linked Services, by Users of DSODentist or Linked Services, and such User Content does not necessarily reflect the opinions or policies of NMG. In addition, NMG is not responsible for any damage, injury or loss caused by Users of DSODentist or by any of the equipment or programming associated with or utilized in DSODentist or Linked Services. Profiles and Linked Services created and posted by Members on, though or in connection with DSODentist may contain links to other mobile apps or services. NMG is not responsible for the Content, accuracy or opinions expressed on such mobile apps and services, and such mobile apps and services are not necessarily investigated, monitored or checked for accuracy or completeness by NMG. Inclusion of any linked mobile app or service on DSODentist does not imply approval or endorsement of the linked mobile app or service by NMG. When you access these third party apps and services, you do so at your own risk. NMG takes no responsibility for third party advertisements or Linked Services that are posted on, through or in connection with DSODentist or Linked Services, nor does it take any responsibility for the goods or services provided by these third parties. NMG is not responsible for the conduct, whether online or offline, of any User of DSODentist or Linked Services. NMG assumes no responsibility for any error, omission, interruption, deletion, defect, delay in operation or transmission, communications line failure, theft or destruction or unauthorized access to, or alteration of, any User or Member communication. NMG is not responsible for any problems or technical malfunction of any telephone network or lines, computer online systems, servers or providers, computer equipment, software, failure of any email or players due to technical problems or traffic congestion on the Internet or on any of DSODentist or Linked Services or combination thereof, including, without limitation, any injury or damage to Users or to any person's computer related to or resulting from participation or downloading materials in connection with DSODentist or Linked Services. Under no circumstances shall NMG be responsible for any loss or damage, including, without limitation, personal injury or death, resulting from use of DSODentist or Linked Services, attendance at an NMG event, from any User Content posted on or through DSODentist or Linked Services, or from the conduct of any Users of DSODentist, whether online or offline. DSODentist and Linked Services are provided \"AS-IS\" and as available and NMG expressly disclaims any warranty of fitness for a particular purpose or non-infringement. NMG cannot guarantee and does not promise any specific results from use of DSODentist or Linked Services. <br><br>\n    14. Limitation on Liability. IN NO EVENT SHALL NMG BE LIABLE TO YOU OR ANY THIRD PARTY FOR ANY INDIRECT, CONSEQUENTIAL, EXEMPLARY, INCIDENTAL, SPECIAL, OR PUNITIVE DAMAGES, INCLUDING, WITHOUT LIMITATION, LOST PROFIT DAMAGES ARISING FROM YOUR USE OF DSODENTIST OR LINKED SERVICES, EVEN IF NMG HAS BEEN ADVISED OF THE POSSIBILITY OF SUCH DAMAGES. NOTWITHSTANDING ANYTHING TO THE CONTRARY CONTAINED HEREIN, NMG'S LIABILITY TO YOU FOR ANY CAUSE WHATSOEVER AND REGARDLESS OF THE FORM OF THE ACTION, WILL AT ALL TIMES BE LIMITED TO THE AMOUNT PAID, IF ANY, BY YOU TO NMG FOR DSODENTIST DURING THE TERM OF MEMBERSHIP. <br><br>\n    15. U.S. Export Controls. Software available in connection with DSODentist (the \"Software\") is further subject to United States export controls. No Software may be downloaded from DSODentist or otherwise exported or re-exported in violation of U.S. export laws. Downloading or using the Software is at your sole risk. <br><br>\n    16. Disputes. The Agreement shall be governed by, and construed in accordance with, the laws of the State of New Jersey, without regard to its conflict of law provisions. You and NMG agree to submit to the exclusive jurisdiction of the courts located within the State of New Jersey to resolve any dispute arising out of the Agreement or DSODentist. EACH OF THE PARTIES HEREBY KNOWINGLY, VOLUNTARILY AND INTENTIONALLY WAIVES ANY RIGHT IT MAY HAVE TO A TRIAL BY JURY IN RESPECT OF ANY LITIGATION (INCLUDING, BUT NOT LIMITED TO, ANY CLAIMS, COUNTERCLAIMS, CROSS-CLAIMS, OR THIRD PARTY CLAIMS) ARISING OUT OF, UNDER OR IN CONNECTION WITH THIS AGREEMENT. FURTHER, EACH PARTY HERETO CERTIFIES THAT NO REPRESENTATIVE OR AGENT OF EITHER PARTY HAS REPRESENTED, EXPRESSLY OR OTHERWISE, THAT SUCH PARTY WOULD NOT IN THE EVENT OF SUCH LITIGATION, SEEK TO ENFORCE THIS WAIVER OF RIGHT TO JURY TRIAL PROVISION. EACH OF THE PARTIES ACKNOWLEDGES THAT THIS SECTION IS A MATERIAL INDUCEMENT FOR THE OTHER PARTY ENTERING INTO THIS AGREEMENT. <br><br>\n    17. Indemnity. You agree to indemnify and hold NMG, its subsidiaries, and affiliates, subcontractors and other partners, and their respective officers, agents, partners and employees, harmless from any loss, liability, claim, or demand, including, but not limited to, reasonable attorneys' fees, made by any third party due to or arising out of your use of DSODentist in violation of this Agreement and/or arising from a breach of this Agreement and/or any breach of your representations and warranties set forth in this Agreement and/or any Content that you post on, through or in connection with DSODentist. <br><br>\n    18. Other. This Agreement is accepted upon your use of DSODentist or any of DSODentist Services and is further affirmed by you becoming a Member. Your agreement with NMG will always include this Agreement at a minimum. Your access and use of certain DSODentist Services will require you to accept additional terms and conditions applicable to such certain DSODentist Services, in addition to this Agreement, and may require you to download Software or Content. The failure of NMG to exercise or enforce any right or provision of this Agreement shall not operate as a waiver of such right or provision. The section titles in this Agreement are for convenience only and have no legal or contractual effect. DSODentist is a trademark of NMG. This Agreement operates to the fullest extent permissible by law. If any provision of this Agreement is unlawful, void, or unenforceable, that provision is deemed severable from this Agreement and does not affect the validity and enforceability of any remaining provisions. <br><br>\n    To contact us regarding any questions about this Agreement, please use the Contact NMG form on our Help site. <br><br>\n    I HAVE READ THIS AGREEMENT AND AGREE TO ALL OF THE PROVISIONS CONTAINED ABOVE.\n  </ng-template>\n  <ng-template #policy>\n      1. Introduction <br> Questions. If you have any questions or concerns about our privacy policy, contact our privacy team by emailing rgroves@thenextmediagroup.com. You may also contact us by mail at 1000 Wyckoff Avenue, Mahwah, NJ, 07430. <br><br> Scope. This privacy policy covers all of DSODentist. It does not, however, apply to entities that Next Media Group, Inc. does not own or control, such as websites or mobile apps using the platform. By using or accessing DSODentist, you agree to the privacy practices outlined herein. <br><br> No information from children under age 18. If you are under age 18, please do not attempt to register for DSODentist or provide any personal information about yourself to us. If we learn that we have collected personal information from a user under age 18, we will delete that information as quickly as possible. If you believe that we might have any information from a child under age 18, please contact us by emailing rgroves@thenextmediagroup.com. <br><br> Parental participation. We strongly recommend that minors 18 years of age or older ask their parents for permission before sending any information about themselves to anyone over the Internet and we encourage parents to teach their children about safe internet use practices. <br><br><br>\n      2. Information We Receive <br> Information you provide to us: Information About Yourself. When you enroll in DSODentist you provide us with information such as your name, email, and projected graduation date. During the registration process, we give you the opportunity to connect with your peers and dental professionals from around the country. You will also be able to add a picture of yourself. In some cases we may ask for additional information for security reasons or to provide specific services to you. Once you register, you can provide other information about yourself by connecting with, for example, your fellow peers, groups, networks, and communities. <br><br> Content. One of the primary reasons dental professionals use DSODentist is to access educational materials, to share such content with others, and to find mentors nearby. Examples include when you upload or take a photo, upload or record a video, share a link to an instructional article or animation, create an event or a group, make a comment, or send someone a message. If you do not want us to store metadata associated with content you share on DSODentist (e.g., photos), please remove the metadata before uploading the content. <br><br> Information we collect when you interact with DSODentist: <br> App activity information. We keep track of some of the actions you take on DSODentist, such as adding connections (including joining a group or adding a peer or adding a mentor), creating a photo album, commenting on an article, rating a content feature, or attending an event. In some cases, you are also taking an action when you provide information or content to us. For example, if you share a video, in addition to storing the actual content you uploaded, we might log the fact that you shared it. <br><br> Access Device and Browser Information. When you access DSODentist from a computer, mobile phone, or other device, we may collect information from that device about your browser type, location, and IP address, as well as the pages you visit. <br><br> Cookie Information. We use \"cookies\" (small pieces of data we store for an extended period of time on your computer, mobile phone, or other device) to make DSODentist easier to use, to improve the quality of the educational contents shared herein, to make our advertising better, and to protect both you and DSODentist. For example, we use them to store your login ID (but never your password) to make it easier for you to login whenever you return to DSODentist. We also use them to confirm that you are logged into DSODentist, and to know when you are interacting with our widgets and Share buttons and app advertisements. You can remove or block cookies using the settings in your browser, but in some cases that may impact your ability to use DSODentist. <br><br> Information from other mobile apps. We may institute programs with advertising partners and other mobile apps in which they share information with us: <br><br>\n      <ul>\n        <li>\n          We may ask advertisers to tell us how our users responded to the ads we showed them (and for comparison purposes, how other users who didn’t see the ads acted on their site). This data sharing, commonly known as “conversion tracking,” helps us measure our advertising effectiveness and improve the quality of the advertisements seen by dental students and professionals.\n        </li><br>\n        <li>\n          We may receive information about whether or not you’ve seen or interacted with certain ads on other sites in order to measure the effectiveness of those ads.\n        </li>\n      </ul><br>\n      If in any of these cases we receive data that we do not already have, we will “anonymize” it within 180 days, meaning we will stop associating the information with any particular user. If we institute these programs, we will only use the information in the ways we explain in the “How We Use Your Information” section below. <br><br> Information from other users. We may collect information about you from other DSODentist users, such as when a connection tags you in a photo or video, or provides details regarding a group you share. <br><br><br>\n      3. Sharing information on DSODentist. <br> This section explains how your privacy settings work, and how your information is shared on DSODentist.  You should always consider your privacy settings before sharing information on DSODentist. <br><br> Name and Profile Picture. DSODentist is designed to make it easy for you to find dental education content and connect with other dental students and professionals.  For this reason, your name and profile picture do not have privacy settings. If you are uncomfortable with sharing your profile picture, you should delete it (or not add one). <br><br> Contact Information. Your enrollment form--accessible through the \"My Settings\" icon--enables you to control the notifications and preferences associated with your user profile. <br><br> Other.  Additional points to consider: <br><br>\n      <ul>\n        <li>\n          Some of the content you share and the actions you take will show up on your connections’ home pages and other pages they visit.\n        </li><br>\n        <li>\n          Even after you remove information from your profile or delete your account, copies of that information may remain viewable elsewhere to the extent it has been shared with others, it was otherwise distributed pursuant to your privacy settings, or it was copied or stored by other users.\n        </li><br>\n        <li>\n          You understand that information might be re-shared or copied by other users.\n        </li><br>\n        <li>\n          Certain types of communications that you send to other users cannot be removed, such as messages.\n        </li><br>\n        <li>\n          When you post information on another user’s profile or comment on another user’s post, that information will be subject to the other user’s privacy settings.\n        </li><br>\n      </ul><br><br>\n      4. Information You Share With Third Parties. <br> Connecting with an Application or Mobile app.  When you connect with an application or mobile app it may have access to General Information about you.  The term General Information includes you and your connections’ names, profile pictures, year of graduation, and content you shared.  We may also make information about the location of your computer or access device and your academic concentration available to applications and mobile apps in order to help them implement appropriate security measures and control the distribution of age-appropriate content.  If the application or mobile app wants to access any other data, it will have to ask for your permission. <br><br> You should always review the policies of third-party applications and mobile apps to make sure you are comfortable with the ways in which they use information you share with them. We do not guarantee that they will follow our rules. If you find an application or mobile app that violates our rules, you should report the violation to us by emailing rgroves@thenextmediagroup.com and we will take action as necessary. <br><br> Pre-Approved Third-Party Mobile Apps and Applications.  In order to provide you with useful social experiences from DSODentist, we occasionally need to provide General Information about you to pre-approved third-party mobile apps that use DSODentist at the time you visit them (if you are still logged in to DSODentist). You can also block a particular pre-approved mobile app or application by clicking \"No Thanks\" in the user window when you visit that application or mobile app.  In addition, if you log out of DSODentist before visiting a pre-approved application or mobile app, it will not be able to access your information. <br><br> Exporting Information. You (and those you make your information available to) may use tools like RSS feeds, mobile phone address book applications, or copy and paste functions, to capture, export (and in some cases, import) information from DSODentist, including your information and information about you. <br><br> Advertisements. Sometimes the advertisers who present ads on DSODentist use technological methods to measure the effectiveness of their ads and to personalize advertising content. You may opt-out of the placement of cookies by using your browser cookie settings to limit or prevent the placement of cookies by advertising networks. <br><br> Links. When you click on links within DSODentist you may leave our app. We are not responsible for the privacy practices of other sites, and we encourage you to read their privacy statements. <br><br><br>\n      5. How We Use Your Information <br> Next Media Group uses the information collected through DSODentist to try to provide an educational, efficient, and customized experience. Here are some of the details on how we do that: <br><br> To manage the service. We use the information we collect to provide our educational services and features to you, to measure and improve those services and features, and to provide you with customer support. We use the information to prevent potentially illegal activities, and we use a variety of technological systems to detect and address anomalous activity and screen content to prevent abuse such as spam. These efforts may on occasion result in a temporary or permanent suspension or termination of some functions for some users. <br><br> To contact you. We may contact you with service-related announcements from time to time. We may include content you see on DSODentist in the emails we send to you. <br><br> To serve personalized advertising to you. We know how important focus is on your professional development, and while you're pursuing your university degree we will not share your information with advertisers without your consent. (An example of consent would be if you asked us to provide your mailing address to an advertiser to receive a free sample.) We allow advertisers to choose the characteristics of users who will see their advertisements and we may use any of the non-personally identifiable attributes we have collected (including information you may have decided not to show to other users, such as your graduation year or other such personal information or educational preferences) to select the appropriate audience for those advertisements. For example, we might use your interest in operative dentistry to show you ads for adhesive products, but we do not tell the advertiser/manufacturer who you are. As a dental student or professional, we do not share your information with advertisers without your consent, but when you click on or otherwise interact with an advertisement there is a possibility that the advertiser may place a cookie in your browser and note that it meets the criteria they selected. <br><br> To supplement your profile. We may use information about you that we collect from other DSODentist users to supplement your profile (such as when you are tagged in a photo or mentioned in a status/group update). In such cases, we generally give you the ability to remove the content (such as allowing you to remove a photo tag of you) or limit its visibility on your profile. <br><br> To help your connections find you. We allow other users to use contact information they have about you, such as your email address, to find you, including through contact importers and search.  You can prevent other users from using your email address to find you using the search section of your privacy settings. <br><br><br>\n      6. How We Share Information <br> DSODentist facilitates the sharing of dental education content and such information with others — connections and educators in your communities — while providing you with privacy settings that you can use to restrict other users from accessing some of your information. We share your information with third parties when we believe the sharing is permitted by you, reasonably necessary to offer our services, or when legally required to do so. For example: <br><br> When you invite a peer to join. When you ask us to invite a peer to join DSODentist, we will send your fellow dental peer a message on your behalf using your name.  The invitation may also contain information about other users your peers might know.   We may also send up to two reminders to them in your name. <br><br> When you choose to share your information with marketers. You may choose to share information with dental manufacturers through offers on DSODentist. This is entirely at your discretion and while you are enrolled in DSODentist as a dental student or professional we will not provide your information to such marketers without your consent. <br><br>\n      When we share your information with marketers. Your contact information may only be shared with sponsors of DSODentist after you have graduated from dental school. On certain occasions, information may be shared in advance of your graduation to designated sponsors who offer job opportunities and/or special services that we believe will be of interest and benefit to you prior to graduation. The information we share will be limited to the following; your dental school, year of graduation, intended dental specialty (if any), and your contact information. <br><br> To help your peers find you. By default, we make certain information you have posted to your profile available in search results on DSODentist to help your peers find you. You can control who can see some of this information, however, as well as who can find you in these searches, through your privacy settings. <br><br> To give search engines access to publicly available information. We generally limit search engines’ access to our app. We may allow them to access information published by Next Media Group, Inc and user-generated information set to the “everyone” setting (along with your name and profile picture) and your profile information that is visible to everyone.  You can change the visibility of some of your profile information using the customizable sections of your privacy settings. <br><br> To help improve or promote our service. Sometimes we share aggregated information with third parties to help improve or promote our service. But we only do so in such a way that no individual user can be identified or linked to any specific action or information. <br><br> To provide you with services. We may provide information to service providers that help us bring you the services we offer. For example, we may use third parties to help host our mobile app, send out email updates about DSODentist, remove repetitive information from our user lists, process payments, or provide search results or links (including sponsored links). These service providers may have access to your personal information for use for a limited time, but when this occurs we implement reasonable contractual and technical protections to limit their use of that information to helping us provide the service. <br><br> To advertise our services. We may ask advertisers outside of DSODentist to display ads promoting our services. We may ask them to deliver those ads based on the presence of a cookie, but in doing so will not share any other information with the advertiser. <br><br> To respond to legal requests and prevent harm. We may disclose information pursuant to subpoenas, court orders, or other requests (including criminal and civil matters) if we have a good faith belief that the response is required by law. This may include respecting requests from jurisdictions outside of the United States where we have a good faith belief that the response is required by law under the local laws in that jurisdiction, apply to users from that jurisdiction, and are consistent with generally accepted international standards. We may also share information when we have a good faith belief it is necessary to prevent fraud or other illegal activity or to prevent imminent bodily harm. This may include sharing information with other companies, lawyers, courts or other government entities. <br><br> Transfer in the Event of Sale or Change of Control. If the ownership of all or substantially all of our business changes, we may transfer your information to the new owner so that the service can continue to operate. In such a case, your information would remain subject to the promises made in any pre-existing Privacy Policy. <br><br><br>\n       \n      7. How You Can Change or Remove Information <br> Editing your profile. You may change or remove your profile information at any time by going to your profile page and clicking “Edit My Profile.” Information will be updated immediately. <br><br> Deactivating or deleting your account. If you want to stop using your account you may deactivate it or delete it. When you deactivate an account, no user will be able to see it, but it will not be deleted. We save your profile information (connections, photos, etc.) in case you later decide to reactivate your account. Many users deactivate their accounts for temporary reasons and in doing so are asking us to maintain their information until they return to DSODentist. You will still have the ability to reactivate your account and restore your profile in its entirety. When you delete an account, it is permanently deleted from DSODentist. You should only delete your account if you are certain you never want to reactivate it. You may deactivate your account on your My Profile page or delete your account by emailing us accordingly at rgroves@thenextmediagroup.com. <br><br> Limitations on removal. Even after you remove information from your profile or delete your account, copies of that information may remain viewable elsewhere to the extent it has been shared with others, it was otherwise distributed pursuant to your privacy settings, or it was copied or stored by other users. However, your name will no longer be associated with that information on DSODentist. (For example, if you post something to another user’s profile and then you delete your account, that post may remain, but be attributed to an “Anonymous DSODentist User.”)  Additionally, we may retain certain information to prevent identity theft and other misconduct even if deletion has been requested. If you have given third-party mobile apps access to your information, they may retain your information to the extent permitted under their terms of service or privacy policies.  But they will no longer be able to access the information through our Platform after you disconnect from them. <br><br> Backup copies. Removed and deleted information may persist in backup copies for up to 90 days, but will not be available to others. <br><br> Non-user contact information. If a user provides your email address to us, and you are not a user of DSODentist but you want us to delete your address, you can do so by emailing rgroves@thenextmediagroup.com. However, that request will only apply to addresses we have at the time of the request and not to any addresses that users provide to us later. <br><br><br>\n      8. How We Protect Information <br> We do our best to keep your information secure, but we need your help. <br><br> Steps we take to keep your information secure. We keep your account information on a secured server behind a firewall. When you enter sensitive information, we encrypt that information using secure socket layer technology (SSL). We also use automated and social measures to enhance security, such as analyzing account behavior for fraudulent or otherwise anomalous behavior, may limit use of app features in response to possible signs of abuse, may remove inappropriate content or links to illegal content, and may suspend or disable accounts for violations. <br><br> Risks inherent in sharing information. Although we allow you to set privacy options that limit access to your information, please be aware that no security measures are perfect or impenetrable. We cannot control the actions of other users with whom you share your information. We cannot guarantee that only authorized persons will view your information. We cannot ensure that information you share on DSODentist will not become publicly available. We are not responsible for third-party circumvention of any privacy settings or security measures on DSODentist. You can reduce these risks by using common sense security practices such as choosing a strong password. <br><br><br>\n      9. Other Terms <br> Changes. We may change this Privacy Policy from time to time in order to improve the service of DSODentist. Unless stated otherwise, our current privacy policy applies to all information that we have about you and your account. If we make changes to this Privacy Policy we will notify you by publication here. If the changes are material, we will provide you additional, prominent notice as appropriate under the circumstances. <br><br> Consent to Collection and Processing in the United States. By using DSODentist, you consent to having your personal data transferred to and processed in the United States. <br><br> Defined Terms. \"Us,\" \"we,\" \"our,\" and \"DSODentist\" refer to Next Media Group, Inc. and its mobile app developed for the education of dental students and professionals unless otherwise limited by the context. <br><br>\n      Copyright © 2017 Next Media Group, Inc. All rights reserved.\n  </ng-template>\n</mat-dialog-content>\n<mat-dialog-actions align=\"end\">\n  <button mat-button mat-dialog-close>Close</button>\n</mat-dialog-actions>\n"

